INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 125801, 1, 40011, 24001, 1, 0, 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 126001, 1, 40011, 24001, 2, 0, 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 323, "んーと。\nこれ、あげる。\nはい", "プレシア", 126101, 1, 40011, 24001, 3, 0, 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (2, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 125801, 1, 40011, 24001, 4, 0, 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (2, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 126001, 1, 40011, 24001, 5, 0, 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (2, 326, "お兄。\nきてくれて、うれしい", "プレシア", 126101, 1, 40011, 24001, 6, 0, 2);
